Nested Schema in Mongoose with NestJS<p>I am trying to parse a response from Google's API into Mongoose using Nestjs, but I can't understand what is the correct way to parse and create a Schema for nested json objects, can someone help?</p>
<p>This is my JSON response:</p>
<pre><code>{
  &quot;reviewId&quot;: &quot;f1a0ec26-9aca-424f-8b05-cff6aa3d2337&quot;,
  &quot;authorName&quot;: &quot;Some User&quot;,
  &quot;comments&quot;: [
    {
      &quot;userComment&quot;: {
        &quot;text&quot;: &quot;\tAmazing!&quot;,
        &quot;lastModified&quot;: {
          &quot;seconds&quot;: &quot;1659685904&quot;,
        },
        &quot;starRating&quot;: 5,
        &quot;reviewerLanguage&quot;: &quot;en&quot;,
      }
    },
    {
      &quot;developerComment&quot;: {
        &quot;text&quot;: &quot;Thank you.&quot;,
        &quot;lastModified&quot;: {
          &quot;seconds&quot;: &quot;1659688852&quot;,
        }
      }
    }
  ]
}
</code></pre>
<p>This is my Scheme:</p>
<pre><code>import * as mongoose from 'mongoose';

export interface Review extends mongoose.Document {
  authorName: string;
  reviewId: string;
  userComment: {
    text: string;
    lastModified: string;
    starRating: number;
    reviewerLanguage: string;
  };
}

export const ReviewSchema = new mongoose.Schema({
  authorName: { type: String, required: true },
  reviewId: { type: String, index: { unique: true }, required: true },
  userComment: {
    text: { type: String, required: false },
    lastModified: { type: String, required: false },
    starRating: { type: Number, required: false },
    reviewerLanguage: { type: String, required: false },
  },
});
</code></pre>
<p>Then I am trying to create the object when the JSON response returned from the server:</p>
<pre><code>const newReview = new this.reviewModel({
  authorName: review.authorName || 'NO_NAME',
  reviewId: review.reviewId || 'NO_ID',
  userComment.lastModified: review.userComment[0].lastModified || '',
});
</code></pre>
<p><a href="https://i.stack.imgur.com/VTMO7.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/VTMO7.png" alt="enter image description here" /></a></p>
<p><a href="https://i.stack.imgur.com/GOa69.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/GOa69.png" alt="enter image description here" /></a></p>
<p>But I get an error in userComment.lastModified, what is the correct way to do it?</p>

