<p>For example &quot;create_timestamp&quot;: 1641560954619 is January 7, 2022 and &quot;modified_timestamp&quot;: 1641826530378 is January 10, 2022.</p>
<p>I do not have create_timestamp and modified_timestamp for each asset under furniture and equipment.</p>
<p>Here's the <a href="https://mongoplayground.net/p/kvsqfAuPr0B" rel="nofollow noreferrer">mongoplayground link</a></p>
