MongoDB convert a JSON-String to actual Objects of array "[{obj1},{obj2}]"<p>I have imported a dataset which contains several documents and each document contain a genres attribure, Its value is <strong>string - A json string</strong> like <code>&quot;[{'field1':'value1'}, {'field2':'value2'}]&quot;</code>, please notice the <strong>quote</strong> I want this to be array of objects</p>
<pre><code>{
  &quot;genres&quot;: &quot;[{'id': 16, 'name': 'Animation'}, {'id': 35, 'name': 'Comedy'}, {'id': 10751,'name': 'Family'}]&quot;
}
</code></pre>
<p>Above string values to be converted in following way</p>
<pre><code>{
    &quot;title&quot;: &quot;Toy story collection&quot;,
    &quot;genres&quot;: [
        {'id': 16, 'name': 'Animation'}, 
        {'id': 35, 'name': 'Comedy'}, 
        {'id': 10751,'name': 'Family'}
    ]
},
{
    &quot;title&quot;: &quot;Shrek&quot;,
    &quot;genres&quot;: [
        {'id': 16, 'name': 'Animation'} 
    ]
},
{
    &quot;title&quot;: &quot;Full House&quot;,
    &quot;genres&quot;: [
        {'id': 10751,'name': 'Family'}
    ]
}
</code></pre>
<p>This will enable me to search records as follows</p>
<pre><code>db.moviesCollection.find({&quot;genres.name&quot;:&quot;Animation&quot;})
</code></pre>
<p>A solution i can think of is load each document one by one though php or javascript and start converting it.</p>
<p>Is there a way? <strong>I can update documentes directly through mongodb itself</strong> without using any programming lanaguge.</p>
<p>Another answer mention something like following but did not mention if they are using any language.</p>
<pre><code>db.movies_metadata.find({}).snapshot().forEach(function (el){el.genres=JSON.parse(el.genres);db.movies_metadata.save(el)});
</code></pre>
<p>If I run above directly on console, I see following error.</p>
<blockquote>
<p>uncaught exception: TypeError: db.movies_metadata.find(...).snapshot
