          &quot;args&quot;: [
            &quot;$genres&quot;
          ],
          &quot;lang&quot;: &quot;js&quot;
        }
      }
    }
  },
  {
    &quot;$merge&quot;: {
      &quot;into&quot;: &quot;movies_metadata&quot;,
      &quot;on&quot;: &quot;_id&quot;,
      &quot;whenMatched&quot;: &quot;merge&quot;,
      &quot;whenNotMatched&quot;: &quot;insert&quot;
    }
  }
])
</code></pre>

